data.value:
Версия движка, на которую ссылается решение, не соответствует версии движка из '{0}'.
    Путь ссылки: {2}
    Путь целевой версии: {1}
    Перегенерируйте файлы проекта, чтобы исправить это.

Эта опция позволяет настроить, какая форма инициализации должна использоваться при создании нового нестатического члена данных. Например, при применении быстрого исправления к неинициализированному полю в следующем коде:

    class Preview {
        int field;
    };

Если опция включена, будет сгенерировано 'int field {0};', иначе 'int field = 0;'.
